 mamães que adora descobrir curiosidades sobre gatos? Não tem como ser diferente, os felinos são os amores da nossa vida e é claro que queremos conhecer tudo o que está relacionado a eles. Um dos comportamento dos gatos que provavelmente já chamou sua atenção é aquele hábito de deixar ração na beira do pote. Já aconteceu de você colocar ração no pote, o gato comer e ficar miando o tempo todo como se estivesse pedindo mais, sendo que ainda tem na tigela dele?

Entender esse comportamento pode ser um desafio para você, mas é importante que você entenda para evitar situações que prejudiquem a alimentação do gato. Diferente do que muita gente pensa, essa situação não quer dizer que você está colocando ração demais no pote. Esse comportamento tem a ver com os bigodes do gato. Os bigodes do felino são pelos sensoriais de orientação e possuem alta sensibilidade, podendo captar movimentos pela vibração do ar – essa capacidade é o que dá o nome científico vibrissae. São 12 pelos principais de cada lado do focinho com raízes profundas e uma série de terminações nervosas. 

A capacidade de captar movimentos por ondas sonoras é o que permite que os felinos se movimentem com precisão e é devido à sensibilidade dessa área que os gatos deixam toda a ração que fica na beira do pote. Afinal, eles evitam qualquer situação que possa mexer com os bigodes. Não é nada agradável ficar amassando eles nas laterais do pote para pegar os grãos de ração de ficam ali.

